import BudgetModel from './Budget.model';
import ProductModel from './Product.model';
import UserModel from './User.model';

export {
  UserModel,
  ProductModel,
  BudgetModel,
};

import { IProduct, IUser } from '../Interfaces';

export default class BudgetModel {
  public getBudget = async (selectedProducts: IProduct[], { tax }: IUser): Promise<number> => {
    const budget = selectedProducts
      .reduce((acc, { price }) => acc + ((price * tax) / 100), 0);

    return budget;
  }
}

import axios from 'axios';
import { IProduct } from '../Interfaces';

export default class ProductModel {
  private endpoint: string;

  constructor() {
    this.endpoint = 'https://mockend.com/juunegreiros/BE-test-api/products';
  }

  public findAll = async (): Promise<IProduct[]> => {
    const { data } = await axios.get(this.endpoint);
    return data;
  }
}

import axios from 'axios';
import { IUser } from '../Interfaces';

